class User ():
    def __init__(self, id_uni, nombre, correo, cancionActual, reproduciendo):
        self.id_uni = id_uni
        self.nombre = nombre
        self.correo = correo
        self.playlist = []
        self.cancionActual = cancionActual
        self.reproduciendo = reproduciendo


# iniciacion de la clase  cancion
class Cancion(User):
    def __init__(self, id_unic, nombre, artista, album, anioLanzamiento, duracion, genero, contenido):
        self.id_unic = id_unic
        self.nombre = nombre
        self.artista = artista
        self.album = album
        self.anioLanzamiento = anioLanzamiento
        self.duracion = duracion
        self.genero = genero
        self.escuchas = []
        self.contenido = contenido


def add_playlist(self, cancion):
    self.playlist.append(cancion)

# def def_playlist(self,nombrePlaylist):
#     for playlist in self.playlist:
#         playlist.remove(nombrePlaylist)


def reproduciendo(self, activo_no, cancion):
    if activo_no == True:
        self.reproduciendo = activo_no
        self.cancionActual = cancion
        print(self.nombre, "Escuchando", self.cancionActual)
    else:
        self.reproduciendo = activo_no
        self.cancionActual = cancion
        print(self.nombre, "Puso pausa a", self.cancionActual)


def cambioEscuchas(self, user, usuarioName, nameSong):
    if user not in self.escuchas:
        self.escuchas.add(user)
        print(self.escuchas)
        print('El ', usuarioName, 'esta escuchando...', nameSong)
        reproduciendo()
    else:
        print("Este usuario ya esta en la lista de escuchas de esta cancion")


